window.bookSummaryJSON = "<p>After surviving countless perils and dangers, including an examination by the Blood Council, Fred is preparing to take on his most important adventure to date: marrying Krystal. </p> <p>That is, if he can get everything handled in time. Visiting Boarback, hiring new staff, clearing out his schedule for a honeymoon; there's no shortage of tasks to check off before the big day arrives.</p> <p>But not everyone views the occasion in such a happy light. With new dangers looming, old debts raised, and grudges rekindled, it'll take everything Fred has to finally make it down the aisle.</p>"; 
